INSERT INTO `mainenginemodule` VALUES (1, '黑斑病1', '主要受害部位为叶片，前期会在叶片形成一定的斑点，随后开始扩散，导致叶面脱落死亡', '发病时间多处于7-9月份左右', '土壤水分不足，浇水不当，施肥不当', '在秋后要注意清理干枯的枝叶，避免感染病原，感染后先将感染部分提出，随后可用40%杀菌丹可湿性粉剂500倍液或者58%甲霜灵锰锌可湿性粉剂500-800倍液喷洒治理', );
INSERT INTO `mainenginemodule` VALUES (2, '白粉病', '症状表现为叶面会有白色丝状物覆盖，根茎、叶柄处会有白色的霉斑物质存在', '一般在6月初，气温20℃以上为初发期，7、8月为盛发期', '高温、高湿环境，空气不通畅，土壤湿度较大，采光差', '用70%甲基硫菌灵可湿性粉剂800-1000倍液或者40%福星乳油8000－9000倍液喷洒处理伤口。在做好通风处理，防止二次感染', );
INSERT INTO `mainenginemodule` VALUES (3, '炭疽病', '芍药炭疽病危害叶、叶柄及茎的生长，叶部病斑初为长圆形，后面慢慢凹陷，数日后扩大成不规则的黑褐色病斑，空气潮湿，其表面出现粉红色发粘的孢子堆，严重时叶子脱落，茎上病斑与叶上产生的相似，严重时会引起折倒', '炭疽病多在8-9月份多雨季节出现', '种植过密，土壤积水，晚间浇水，水分容易在叶面滞留，有利病菌分生，易发病', '芍药炭疽病用甲基托布津浮剂、多硫悬浮剂等药剂进行防治，每周可以喷1次，连喷2至3次效果比较好。', );
INSERT INTO `mainenginemodule` VALUES (4, '毛虫', '一些蝴蝶和蛾的幼虫以柔软的铁树新叶和嫩芽为食，也会啃食幼年植株的成熟叶子。在严重的感染期间，两三天之内所有的新叶都会被啃食干净。', '春秋是毛虫的泛滥时期，成虫在叶子上产的卵可在24小时内孵化，幼虫的生长非常迅速，完全破坏一片新的叶子可能只需要3-4天。', '这些以铁树为食的鳞翅目昆虫会在体内大量积累铁树的毒素，这些毒素对幼虫以及蛹和成虫提供化学保护，使其免受食肉动物的侵害。', '对这些毛虫可以使用接触性杀虫剂来控制，预防性喷洒通常是无效的，因此必须在春秋高发季节经常观察，一旦发现就马上处理。喷施苏云金芽孢杆菌的制品可以实行有效的生物防治，含这种芽孢杆菌的药品有很多，并且对人的安全性远高于除虫菊酯。', );

